        "title": "[MINI] Sudoku \\in NP",
        "desc": "<p>Algorithms with similar runtimes are said to be in the same complexity class. That runtime is measured in the how many steps an algorithm takes relative to the input size.</p> <p>The class P contains all algorithms which run in polynomial time (basically, a nested for loop iterating over the input).Â  NP are algorithms which seem to require brute force.Â  Brute force search cannot be done in polynomial time, so it seems that problems in NP are more difficult than problems in P.Â  I say it \"seems\" this way because, while most people believe it to be true, it has not been proven.Â  This is the famous P vs. NP conjecture.Â  It will be discussed in more detail in a future episode.</p> <p>Given a solution to a particular problem, if it can be verified/checked in polynomial time, that problem might be in NP.Â  If someone hands you a completed Sudoku puzzle, it's not difficult to see if they made any mistakes.Â  The effort of developing the solution to the Sudoku game seems to be intrinsically more difficult.Â  In fact, as far as anyone knows, in the general case of all possible examples of the game, it seems no strategy can do better on average than just random guessing.</p> <p>This notion of random guessing the solution is where the N in NP comes from:Â Non-deterministic.Â  Imagine a machine with a random input already written in its memory.Â  Given enough such machines, one of them will have the right answer.Â  If they all ran in parallel, one of them could verify it's input in polynomial time.Â  This guess / provided input is often called a witness string.</p> <p>NP is an important concept for many reasons.Â  To me, the most reason to know about NP is a practical one.Â  Depending on your goals or the goals of your employer, there are many challenging problems you may attempt to solve.Â  If a problem you are trying to solve happens to be in NP, then you should consider the implications very carefully.Â  Perhaps you'll be lucky and discover that your particular instance of the problem is easy.Â  Sudoku is pretty easy if only 2 remaining squares need to be filled in.Â  The traveling salesman problem is easy to solve if you live in a country where all roads for a ring with exactly one road in and out.</p> <p>If the problem you wish to solve is not trivial, or if you will face many instances of the problem and expect some will not be trivial, then it's unlikely you'll be able to find the exact solution.Â  Sure, maybe you can grab a bunch of commodityÂ servers and try to scale the heck out of your attempt.Â  Depending on the problem you're solving, that might just work.Â  If you can out-purchase your problem in computing power, then problems in NP will surrender to you.Â  But if your input size ever grows, it's unlikely you'll be able to keep up.</p> <p>If your problem is intractable in this way, all is not lost.Â  You might be able to find an approximate solution to your problem.Â  Good enough is better than no solution at all, right?Â  Most of the time, probably.Â  However, some tremendous work has also been done studying topics like this.Â  Are there problems which are not even approximable in polynomial time?Â  What approximation techniques work best?Â  Alas, those answers lie elsewhere.</p> <p>This episode avoids a discussion of a few key points in order to keep the material accessible.Â  If you find this interesting, you should next familiarize yourself with the notions of NP-Complete, NP-Hard, and co-NP.Â  These are topics we won't necessarily get to in future episodes.Â  Michael Sipser's <a href= \"https://www.amazon.com/Introduction-Theory-Computation-Michael-Sipser/dp/113318779X\"> Introduction to the Theory of Computation</a> is a good resource.</p> <p>Â </p>",
