        "desc": "<p><a href=\"https://www.datarefuge.org/\">DataRefuge</a> is a public collaborative, grassroots effort around the United States in which scientists, researchers, computer scientists, librarians and other volunteers are working to download, save, and re-upload government data. The DataRefuge Project, which is led by the <a href= \"http://www.ppehlab.org/\">UPenn Program in Environmental Humanities</a> and the <a href=\"http://www.library.upenn.edu/\">Penn Libraries</a> group at University of Pennsylvania, aims to foster resilience in an era of anthropogenic global climate change and raise awareness of how social and political events affect transparency.</p> <p>Â </p>",
