        "title": "[MINI] Primer on Deep Learning",
        "desc": "<p><span style=\"font-size: 12pt;\">In this episode, we talk about a high-level description of deep learning. Â Kyle presents a simple game (pictured below), which is more of a puzzle really, to try and give</span> <span style=\"font-size: 12pt;\">Â Linh Da the basic concept.</span></p> <p>Â </p> <p><img src= \"https://assets.libsyn.com/secure/show/54799/dnn-game-0.jpg\" alt=\"\" width=\"500\" height=\"375\" /></p> <p><img src= \"https://assets.libsyn.com/secure/show/54799/dnn-game-2.jpg\" alt=\"\" width=\"500\" height=\"375\" /></p> <p>Â </p> <p><img src=\"https://assets.libsyn.com/secure/show/54799/logo.png\" alt=\"\" width=\"200\" height=\"196\" /></p> <p><span style=\"font-size: 14pt;\">Thanks to our sponsor for this week, the Data Science Association. Please check out their upcoming Dallas conference at <a href= \"http://dallasdatascience.eventbrite.com\">dallasdatascience.eventbrite.com</a></span></p>",
