        "title": "Data Provenance and Reproducibility with Pachyderm",
        "desc": "<p>Versioning isn't just for source code. Being able to track changes to data is critical for answering questions about data provenance, quality, and reproducibility. Daniel Whitenack joins me this week to talk about these concepts and share his work on Pachyderm. <a href=\"http://pachyderm.io/\">Pachyderm</a> is an open source containerized data lake.</p> <p>During the show, Daniel mentioned the <a href= \"https://github.com/gopherds\">Gopher Data Science</a> github repo as a great resource for any data scientists interested in the Go language. Although we didn't mention it, Daniel also did an interesting analysis on the 2016 world chess championship that complements our recent episode on chess well. You can find that post <a href= \"https://medium.com/pachyderm-data/analyzing-the-2016-world-chess-championship-b823d0d2fd11#.5m76x6ror\"> here</a></p> <p>Supplemental music is <a href= \"https://twitter.com/LeeRosevere\">Lee Rosevere's</a> <a href= \"https://www.youtube.com/watch?v=7MeY-EdcAzc\">Let's Start at the Beginning</a>.</p> <p>Â </p> <p>Thanks to Periscope Data for sponsoring this episode. More about them at <a href= \"https://www.periscopedata.com/skeptics\">periscopedata.com/skeptics</a></p> <p><a href=\"https://www.periscopedata.com/skeptics\"><img src= \"http://dataskeptic.com/blog/episodes/2017/src-data-provenance-and-reproducibility-with-pachyderm/periscope-data.jpg\" alt=\"Periscope Data\" /></a></p> <p>Â </p> <p>Â </p> <p>Â </p>",
