        "title": "[MINI] Logistic Regression on Audio Data",
        "desc": "<p>Logistic Regression is a popular classification algorithm. In this episode we discuss how it can be used to determine if an audio clip represents one of two given speakers. It assumes an output variable (isLinhda) is a linear combination of available features, which are spectral bands in the discussion on this episode.</p> <p>Â </p> <p>Keep an eye on the dataskeptic.com blog this week as we post more details about this project.</p> <p>Â </p> <p>Thanks to our sponsor this week, the Data Science Association. Â Please check out their upcoming conference in Dallas on Saturday, February 18th, 2017 via the link below.</p> <p>Â </p> <p><a title=\"Dallas Data Science Conference\" href= \"http://dallasdatascience.eventbrite.com\">dallasdatascience.eventbrite.com</a></p> <p><a href= \"https://www.eventbrite.com/e/dallas-data-science-conference-2017-tickets-30507717404\"> <img src= \"https://s3.amazonaws.com/dataskeptic.com/img-static/data-sci-assn.png\" alt=\"\" width=\"200\" height=\"196\" /></a></p> <p>The figures below are referenced during the episode.</p> <p>Â </p> <p><img src= \"data:image/png;base64,\" alt=\"\" /></p> <p><img src= \"data:image/png;base64,\" alt=\"\" width=\"873\" height=\"279\" /></p> <p><img src= \"data:image/png;base64,\" alt=\"\" width=\"882\" height=\"279\" /></p> <p>Â </p> <p>The top waveform is Linh Da, the bottom is Kyle. Â We use the same order below.</p> <p><img src= \"data:image/png;base64,\" alt=\"\" width=\"525\" height=\"191\" /></p> <p><img src= \"data:image/png;base64,\" alt=\"\" width=\"525\" height=\"191\" /></p>",
