        "title": "Studying Competition and Gender Through Chess",
        "desc": "<p>Prior work has shown that people's response to competition is in part predicted by their gender. Understanding why and when this occurs is important in areas such as labor market outcomes. A well structured study is challenging due to numerous confounding factors. Peter Backus and his colleagues have identified competitive chess as an ideal arena to study the topic. Find out why and what conclusions they reached.</p> <p>Our discussion centers around <a href= \"https://papers.ssrn.com/sol3/papers.cfm?abstract_id=2858984\">Gender, Competition and Performance: Evidence from Real Tournaments</a> from Backus, Cubel, Guid, Sanchez-Pages, and MaÃ±as. A summary of their paper can also be found <a href= \"http://voxeu.org/article/women-competitive-environments-evidence-expert-chess\"> here</a>.</p> <p>Â </p>",
